import React from 'react';

const logos: Record<string, string> = {
    'Indian Oil': 'data:image/png;base64,',
    'Hindustan Petroleum': 'data:image/png;base64,',
    'Bharat Petroleum': 'data:image/png;base64,--Pz/X--P-Pz/X+t//T43Ec/z/v3-uV+/39AAAAAAAAAAAAAAAAAAAAAAAAYF/+AG6nFz3fF40EAAAAAElFTkSuQmCC',
    'Nayara': 'data:image/png;base64,-Pz/X+t//T43Ec/z/v39uV+/39AAAAAAAAAAAAAAAAAAAAAAAAYF/+AG6nFz3fF40EAAAAAElFTkSuQmCC',
    'Jio-BP': 'data:image/png;base64,-Pz/X-88DAAAAAAAAAAAAAAAAAAAAAAAA/A/9A+K0qF5YyO48AAAAAElFTkSuQmCC',
    'default': 'data:image/png;base64,-Pz/X+t//T43Ec/z/v39uV+/39AAAAAAAAAAAAAAAAAAAAAAAAYF/+AG6nFz3fF40EAAAAAElFTkSuQmCC',
};

const BrandLogo: React.FC<{ brand: string; template: string }> = ({ brand, template }) => {
    const [imageError, setImageError] = React.useState(false);
    const logoSrc = logos[brand] || logos['default'];
    const isIndianOilClassic = brand === 'Indian Oil' && template === 'Classic Printer';
    
    const handleImageError = () => {
        setImageError(true);
    };
    
    if (imageError) {
        return (
            <div className="w-full h-full flex items-center justify-center bg-gray-200 dark:bg-gray-600 rounded">
                <span className="text-xs text-gray-500 dark:text-gray-400 font-bold">
                    {brand.charAt(0)}
                </span>
            </div>
        );
    }
    
    return (
        <img 
            src={logoSrc} 
            alt={`${brand} Logo`} 
            className={`w-full h-full object-contain ${isIndianOilClassic ? 'filter grayscale' : ''}`}
            onError={handleImageError}
        />
    );
};

export default BrandLogo;
